const Travel = () => {
    const images = [
        "src/images/481930e6-a96b-4dac-a670-c52ae63491ed.JPG",
        "src/images/DSC_2788.JPG",
        "src/images/DSC_3013.JPG",
        "src/images/DSC_3881.JPG"
    ];
    return (
    <>
       <div className='grid-travel-container'>
        <div className='grid-travel-item-1'>
            <h1>Scroll down to get to know me!</h1>
        </div>
        <div className='grid-travel-item-2'>
            <h1>I've travelled to 20+ countries</h1>
        </div>
        <div className='grid-travel-item-3'>
            <vr></vr>
        </div>
        <div className='grid-travel-item-4'>
            <Slide>
                <div className="each-slide-effect">
                    <div style={{'backgroundImage': `url(${images[0]})`}}>

                    </div>
                </div>
                <div className="each-slide-effect">
                    <div style={{'backgroundImage': `url(${images[1]})`}}>

                    </div>
                </div>
                <div className="each-slide-effect">
                    <div style={{'backgroundImage': `url(${images[2]})`}}>

                    </div>
                </div>
                <div className="each-slide-effect">
                    <div style={{'backgroundImage': `url(${images[3]})`}}>

                    </div>
                </div>
            </Slide>
        </div>
       </div>
    </>
    );
};
export default Travel;
